selector_to_html = {"a[href=\"https://en.wikipedia.org/wiki/Cryptocurrency\"]": "<img src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/4/46/Bitcoin.svg/320px-Bitcoin.svg.png\" alt=\"Wikipedia thumbnail\" style=\"float:left; margin-right:10px;\"><p>A <b>cryptocurrency</b>, <b>crypto-currency</b>, or <b>crypto</b> is a digital currency designed to work as a medium of exchange through a computer network that is not reliant on any central authority, such as a government or bank, to uphold or maintain it.</p>", "a[href^=\"https://en.wikipedia.org/wiki/Cryptocurrency#\"]": "<img src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/4/46/Bitcoin.svg/320px-Bitcoin.svg.png\" alt=\"Wikipedia thumbnail\" style=\"float:left; margin-right:10px;\"><p>A <b>cryptocurrency</b>, <b>crypto-currency</b>, or <b>crypto</b> is a digital currency designed to work as a medium of exchange through a computer network that is not reliant on any central authority, such as a government or bank, to uphold or maintain it.</p>", "a[href=\"#id6\"]": "<aside class=\"footnote brackets\" id=\"id6\" role=\"doc-footnote\">\n<span class=\"label\"><span class=\"fn-bracket\">[</span>6<span class=\"fn-bracket\">]</span></span>\n<p><a class=\"reference external\" href=\"https://blockonomi.com/speculation-cryptocurrency/\">What is Speculation? How Does it Relate to the Cryptocurrency Market</a>.\n19 de septiembre de 2018. Blockonomi.</p>\n</aside>", "a[href=\"#id4\"]": "<aside class=\"footnote brackets\" id=\"id4\" role=\"doc-footnote\">\n<span class=\"label\"><span class=\"fn-bracket\">[</span>4<span class=\"fn-bracket\">]</span></span>\n<p><a class=\"reference external\" href=\"https://cryptocoinspy.com/bitcoin-and-why-its-so-popular-in-developing-nations/\">Bitcoin and why it\u2019s so popular in developing nations</a>.\n28 de agosto de 2019. CryptoCoinSpy.</p>\n</aside>", "a[href=\"#id9\"]": "<aside class=\"footnote brackets\" id=\"id9\" role=\"doc-footnote\">\n<span class=\"label\"><span class=\"fn-bracket\">[</span>9<span class=\"fn-bracket\">]</span></span>\n<p><a class=\"reference external\" href=\"https://www.dinero.com/empresas/articulo/uber-se-va-de-colombia/280693\">Uber se va de Colombia</a>.\n10 de enero de 2020. Dinero.</p>\n</aside>", "a[href=\"#id7\"]": "<aside class=\"footnote brackets\" id=\"id7\" role=\"doc-footnote\">\n<span class=\"label\"><span class=\"fn-bracket\">[</span>7<span class=\"fn-bracket\">]</span></span>\n<p><a class=\"reference external\" href=\"https://www.cnbc.com/2018/02/12/cryptocurrency-speculation-could-hurt-innovation-mas-fintech-exec.html\">Cryptocurrency speculation could \u2018destroy\u2019 innovation, Singapore central bank exec says</a>.\n12 de febrero de 2018. CNBC.</p>\n</aside>", "a[href=\"#id5\"]": "<aside class=\"footnote brackets\" id=\"id5\" role=\"doc-footnote\">\n<span class=\"label\"><span class=\"fn-bracket\">[</span>5<span class=\"fn-bracket\">]</span></span>\n<p><a class=\"reference external\" href=\"https://en.wikipedia.org/wiki/Cryptocurrency\">Cryptocurrency</a>.\nConsultado el 23 de febrero de 2020. Wikipedia.</p>\n</aside>", "a[href=\"#id8\"]": "<aside class=\"footnote brackets\" id=\"id8\" role=\"doc-footnote\">\n<span class=\"label\"><span class=\"fn-bracket\">[</span>8<span class=\"fn-bracket\">]</span></span>\n<p><a class=\"reference external\" href=\"https://derinformatico.uexternado.edu.co/bancarizacion-digital-en-colombia/\">Bancarizaci\u00f3n digital de Colombia</a>.\n27 de octubre de 2015. Universidad Externado de Colombia.</p>\n</aside>", "a[href=\"#\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">\u00bfEstamos preparados para un nuevo tipo de monedas, completamente digitales?<a class=\"headerlink\" href=\"#estamos-preparados-para-un-nuevo-tipo-de-monedas-completamente-digitales\" title=\"Link to this heading\">#</a></h1><p>Reci\u00e9n he comenzado un curso sobre <a class=\"reference external\" href=\"https://programasprofesionales.mit.edu/transformacion-digital-descarga-folleto-old/\">transformaci\u00f3n digital</a>,\npatrocinado por la empresa en la cual trabajo (SIER, <a class=\"reference external\" href=\"https://sistemasinteligentesenred.com.co/\">Sistemas Inteligentes en Red</a>). El tema por estos\nd\u00edas es la tecnolog\u00eda blockchain y de este tuve que presentar un ensayo sobre la aceptaci\u00f3n de monedas digitales basadas en blockchain. Los dej\u00f3 con\nmi participaci\u00f3n.</p><p>Debemos empezar por contextualizar que hoy ya vivimos en una sociedad\nmarcadamente digital y ello incluye las transacciones que diariamente\nrealizamos. Para el 2018, en Colombia las transacciones digitales ya\nrepresentaban el 8.5% del PIB y entre 2013 y 2017 hubo un aumento de 4 puntos\nporcentuales [<a class=\"reference internal\" href=\"#id1\">1</a>]. Tambi\u00e9n hay que destacar iniciativas del sector bancario\npara promover el uso de la moneda digital, como es el caso de banco Davivienda\nen el municipio antioque\u00f1o de Concepci\u00f3n, logrando una alta tasa de utilizaci\u00f3n\npara transacciones cotidianas [<a class=\"reference internal\" href=\"#id2\">2</a>]. Sin embargo, la moneda digital incluye la\ncategor\u00eda de la cual es nuestro inter\u00e9s en esta oportunidad, que son las\ncriptomonedas y su impacto puede tener consecuencias y requerir pol\u00edticas muy\ndiferentes a las contempladas para las monedas digitales que ya usamos (para\nlas cuales, estamos preparados completamente).</p>", "a[href=\"#id3\"]": "<aside class=\"footnote brackets\" id=\"id3\" role=\"doc-footnote\">\n<span class=\"label\"><span class=\"fn-bracket\">[</span>3<span class=\"fn-bracket\">]</span></span>\n<p><a class=\"reference external\" href=\"https://cryptocoin.news/analysis/guides/how-cryptos-can-help-transform-developing-countries-19698/\">How Cryptos Can Help Transform Developing Countries</a>.\n31 de agosto de 2018. CryptoCoin News.</p>\n</aside>", "a[href=\"#id10\"]": "<aside class=\"footnote brackets\" id=\"id10\" role=\"doc-footnote\">\n<span class=\"label\"><span class=\"fn-bracket\">[</span>10<span class=\"fn-bracket\">]</span></span>\n<p><a class=\"reference external\" href=\"https://www.elcolombiano.com/opinion/columnistas/medellin-y-la-cuarta-revolucion-industrial-DC10033055\">Medell\u00edn y la Cuarta Revoluci\u00f3n Industrial</a>.\n15 de enero de 2019. El Colombiano.</p>\n</aside>", "a[href=\"#id1\"]": "<aside class=\"footnote brackets\" id=\"id1\" role=\"doc-footnote\">\n<span class=\"label\"><span class=\"fn-bracket\">[</span>1<span class=\"fn-bracket\">]</span></span>\n<p><a class=\"reference external\" href=\"https://www.larepublica.co/empresas/las-transacciones-digitales-representaron-85-del-pib-de-colombia-para-2018-2891715\">Las transacciones digitales representaron 8,5% del PIB de Colombia para 2018</a>.\nLa Rep\u00fablica. 1 de agosto de 2019.</p>\n</aside>", "a[href=\"#id2\"]": "<aside class=\"footnote brackets\" id=\"id2\" role=\"doc-footnote\">\n<span class=\"label\"><span class=\"fn-bracket\">[</span>2<span class=\"fn-bracket\">]</span></span>\n<p><a class=\"reference external\" href=\"https://www.elespectador.com/noticias/economia/concepcion-primer-municipio-sin-efectivo-colombia-articulo-571537\">Concepci\u00f3n, primer municipio sin efectivo en Colombia</a>.\nEl Espectador. 9 de julio de 2015.</p>\n</aside>", "a[href=\"#estamos-preparados-para-un-nuevo-tipo-de-monedas-completamente-digitales\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">\u00bfEstamos preparados para un nuevo tipo de monedas, completamente digitales?<a class=\"headerlink\" href=\"#estamos-preparados-para-un-nuevo-tipo-de-monedas-completamente-digitales\" title=\"Link to this heading\">#</a></h1><p>Reci\u00e9n he comenzado un curso sobre <a class=\"reference external\" href=\"https://programasprofesionales.mit.edu/transformacion-digital-descarga-folleto-old/\">transformaci\u00f3n digital</a>,\npatrocinado por la empresa en la cual trabajo (SIER, <a class=\"reference external\" href=\"https://sistemasinteligentesenred.com.co/\">Sistemas Inteligentes en Red</a>). El tema por estos\nd\u00edas es la tecnolog\u00eda blockchain y de este tuve que presentar un ensayo sobre la aceptaci\u00f3n de monedas digitales basadas en blockchain. Los dej\u00f3 con\nmi participaci\u00f3n.</p><p>Debemos empezar por contextualizar que hoy ya vivimos en una sociedad\nmarcadamente digital y ello incluye las transacciones que diariamente\nrealizamos. Para el 2018, en Colombia las transacciones digitales ya\nrepresentaban el 8.5% del PIB y entre 2013 y 2017 hubo un aumento de 4 puntos\nporcentuales [<a class=\"reference internal\" href=\"#id1\">1</a>]. Tambi\u00e9n hay que destacar iniciativas del sector bancario\npara promover el uso de la moneda digital, como es el caso de banco Davivienda\nen el municipio antioque\u00f1o de Concepci\u00f3n, logrando una alta tasa de utilizaci\u00f3n\npara transacciones cotidianas [<a class=\"reference internal\" href=\"#id2\">2</a>]. Sin embargo, la moneda digital incluye la\ncategor\u00eda de la cual es nuestro inter\u00e9s en esta oportunidad, que son las\ncriptomonedas y su impacto puede tener consecuencias y requerir pol\u00edticas muy\ndiferentes a las contempladas para las monedas digitales que ya usamos (para\nlas cuales, estamos preparados completamente).</p>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
